import React, { Component } from 'react'
import './UserView.jsx'

import Content from '../../components/Content/Content'

const HeaderProps = {
    title: "Listagem de pessoas"
}

const abc = [{
    nome: "wagner",
    idade: 23
},{
    nome: "Alves",
    idade: 23
}
]
class UserView extends Component {
    render() {
        return (
            <Content {...HeaderProps}>
                <div>
                    <form action="">
                        <table responsive>
                            <thead>
                                <tr>
                                    <th>#</th>
                                    {abc.map((_, index) => (
                                        <th key={index}>Table heading</th>
                                    ))}
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                    <td>1</td>
                                    {abc.map((_, index) => (
                                        <td key={index}>Table cell {index}</td>
                                    ))}
                                </tr>
                                <tr>
                                    <td>2</td>
                                    {abc.map((_, index) => (
                                        <td key={index}>Table cell {index}</td>
                                    ))}
                                </tr>
                                <tr>
                                    <td>3</td>
                                    {abc.map((_, index) => (
                                        <td key={index}>Table cell {index}</td>
                                    ))}
                                </tr>
                            </tbody>
                        </table>
                    </form>
                </div>
            </Content>
        )
    }
}

export default UserView;
